const ancetsReduser = (state = initialState, action) => {  
    switch (action.type) {  
        case CREATE:  
            return [  
                ...state,  
                action.data  
            ]  
        case UPDATE:  
            return state.map(item => {  
                if (item.id === action.id) {  
                    return {  
                        ...item,  
                        ...action.data  
                    }  
                } else {  
                    return item  
                }  
            })  
        case DELETE:  
            return state.filter(item => item.id !== action.id && item.idUser !== action.idUser)  
        default:  
            return state  
    }  
}

const createAncetsAC = (data) => ({
    type: CREATE,
    data: data,
})
const deleteAncetsAC = (id, idUser) => ({
    type: DELETE,
    id: id,
    idUser: idUser,
})
export { ancetsReduser, createAncetsAC, deleteAncetsAC }